import React from 'react';
import ReactDOM from 'react-dom';
import Router from './scenes/router';
import './styles.css';
import Api from './scenes/api';

class App extends React.Component {
  constructor(props) {
    super(props);
    Api.init();
  }
  render() {
    return (
      <div className="root">
        <Router />
      </div>
    );
  }
}

ReactDOM.render(<App />, document.getElementById('root'));
